pragma solidity 0.8.4;
import "@openzeppelin/contracts/access/Ownable.sol";
import './interfaces/IBSCV.sol';
import './interfaces/IBANK.sol';


contract Bank is Ownable,IBANK{
    IBSCV public BSCV;

    mapping(uint256 => mapping(uint256 => uint256))withdrawStatement; 

    uint256 public totalWithdrawals;

    function withdraw(address _to,uint256 _amount)external override onlyOwner{
        BSCV.transferFrom(address(this),_to,_amount);
        withdrawStatement[totalWithdrawals][block.number]=_amount;
        totalWithdrawals ++;
    }  

    function setBSCV(IBSCV _bscv)public onlyOwner{
       BSCV = _bscv;
    }
}
